  false,\n\t\"url\": null,\n\t\"notes\": \"This tabular data set represents the area
  of surficial geology types in square meters compiled for every MRB_E2RF1 catchment
  of selected Major River Basins (MRBs, Crawford and others, 2006). The source data
  set is the \"Digital data set describing surficial geology in the conterminous US\"
  (Clawges and Price, 1999). The MRB_E2RF1 catchments are based on a modified version
  of the U.S. Environmental Protection Agency's (USEPA) ERF1_2 and include enhancements
  to support national and regional-scale surface-water quality modeling (Nolan and
  others, 2002; Brakebill and others, 2008). Data were compiled for every MRB_E2RF1
  catchment for the conterminous United States covering New England and Mid-Atlantic
  (MRB1), South Atlantic-Gulf and Tennessee (MRB2), the Great Lakes, Ohio, Upper Mississippi,
  and Souris-Red-Rainy (MRB3), the Missouri (MRB4), the Lower Mississippi, Arkansas-White-Red,
  and Texas-Gulf (MRB5), the Rio Grande, Colorado, and the Great basin (MRB6), the
  Pacific Northwest (MRB7) river basins, and California (MRB8).\",\n\t\"license_title\":
